import React from 'react';
import styled from 'styled-components';
import Button from '../common/Button';

const Wrapper = styled.section`
  border: 1.5px solid #FEA82F;
  border-radius: 10px;

  .qwer {
    display: flex;
    
  }

  .asdf {
    margin: 35px 70px 35px 70px;
    display: flex;
    flex-direction: column;
  }

  .zxcv {
    display: inlinel
  }

`;

const Summary = (props) => {
  return <>
  <Wrapper>
    <div className="qwer">
      <img src="assets/images/summary.png" alt="img" />
      <div className="asdf">
        <h2>독서모임 이름</h2>
        <p>독서모임 인원</p>
        <p>독서모임 일정</p>
        <p>독서모임 주제</p>
        <img className="zxcv" src="assets/images/icons/heart.png" alt="icon" />
        <Button />
      </div>
    </div>
  </Wrapper>
    
  </>;
};

export default Summary;
